photo.description:
&quot;Spectat ad Biblio[thecam] S. Francisci P.F. Reformat[orum]? Cenet[ae]&quot;
Ms. ownership inscription of the library of Convento di San Francesco di Ceneda of the Reformed Franciscans.
Second inscription: &quot;Donum D. Bartholom[a]ei Zorzi de Ampitio&quot;
Probably Bartolomeo Zorzi d'Ampezzo (no dates).

Penn Libraries call number: IndC K1247 Ei552m
<a href="http://www.flickr.com/photos/58558794@N07/tags/indck1247ei552m/">All images from this book</a>

Right board

{Ipse}
enim Pater amat uos q{uia}
uos me amastis et cred{idistis}
{alleluia}

Portion of a parchment leaf from a liturgical ms., probably an antiphonary, containing text and music for the antiphon for the canticle (Magnificat) sung at vespers on <a href="http://divinumofficium.com/cgi-bin/horas/Pofficium.pl?date1=05-30-2011&amp;command=prayVespera&amp;version=Trident 1570&amp;testmode=regular&amp;lang2=English&amp;votive=" rel="nofollow">feria II in Rogationibus</a>. Written in a Gothic bookhand. Text and neumes in dark (now brown?) ink; 4-line staves in red.

Penn Libraries call number: IndC K1247 Ei552m
<a href="http://www.flickr.com/photos/58558794@N07/tags/indck1247ei552m/">All images from this book</a>

Ownership inscription with illegible name: &quot;[...] est posessor huius libri ...&quot;

Penn Libraries call number: LatC V5874.3 1515
<a href="http://www.flickr.com/photos/58558794@N07/tags/latcv587431515/">All images from this book</a>

Presentation inscription to Don Francisco Castanys(?) in January 1832 from Joseph Subivana(?) 
&quot;[...] regalo y merce [...] de la traduccio de las obras de Virgilio mon amichi Don Francisco Castanys en janer de 1832. Joseph Subivana ... Farmacia y apotecuri(?) en Centellas Provincia de Barcelona.&quot;

Penn Libraries call number: LatC V5874 Ek3 1586

&quot;Questo libro è di me Riccardo Bagnara Anno 1697&quot;
&quot;Comprato da me ad Fab.&quot;
Ownership inscription dated 1697 of Riccardo Bagnara

Penn Libraries call number: IC55 C6985 576c 1667
<a href="http://www.flickr.com/photos/58558794@N07/tags/ic55c6985576c1667/">All images from this book</a>

